import {
  SlFormatNumber
} from "./chunk.OZFBKUH7.js";

// src/react/format-number/index.ts
import * as React from "react";
import { createComponent } from "@lit/react";
var tagName = "sl-format-number";
SlFormatNumber.define("sl-format-number");
var reactWrapper = createComponent({
  tagName,
  elementClass: SlFormatNumber,
  react: React,
  events: {},
  displayName: "SlFormatNumber"
});
var format_number_default = reactWrapper;

export {
  format_number_default
};
